import React from "react";

const About = () => {
  return (
    <div className="About">
      <h3>Back up your contacts</h3>
      <ul>
        <li>Safely back up the contacts and personal details</li>
        <li>Access the contacts in your react app</li>
      </ul>

      <h3>Keep your contacts organised and up to date</h3>
      <ul>
        <li>view your contacts by opening this app</li>
        <li>
          Easily add contacts and edit information such as phone numbers, emails{" "}
        </li>
      </ul>
    </div>
  );
};
export default About;
